(7, 'BootStrap 4 New Features and Enhancements', 'Themost-awaited <b>Bootstrap 4</b> stable version has finally shipped out. It seems to prove it right as said by Fulton J Sheen <code>â€“ Patience is power.</code> It is not an absence of action rather it is timing. <br>It waits for the right time to act, for the right principles and in the right way.â€\r\n<br><br>\r\nBootstrap is a powerful front-end framework for the faster development of responsive, mobile-first web layouts. It has undergone the revolutionary changes to give you a highly-customizable environment for better user experiences. It was a long journey with first Bootstrap alpha release from <code>2015 to January 18, 2018</code> ; <br>to make it to a Bootstrap 4 stable release. Bootstrap 4 update is worth this patience. <br>The main highlight of the release is the new Bootstrap 4 examples page for smooth migration from Bootstrap 3 to Bootstrap 4. <br><br> Along with the print styles and utility classes updations, additional border utilities and SaaS maps & much more. So,here at Templatetoaster Bootstrap builder, letâ€™s check out the all-new features and enhancements it is providing with Bootstrap 4 Stable release.\r\n<br><br>\r\n<b>1.</b> Updated Print Styles and Utility Classes\r\nThere is a great improvement in the rendering of printed pages. It ensures the reasonable size of pages rather than making them fit mobile screens only. The print utility classes hold a new set of display values to match standard display utilities.\r\n<br><br>\r\n<b>2</b>. Additive Border Utilities\r\nIt is providing additive border utilities to quickly add all borders to your components. The default border is set to a solid 1px light gray color.\r\n<br><br>\r\n<b>3.</b> Sass Map Updations\r\nThe $spacers and $sizes Sass maps are updated for more customizations. They will work the same way as color maps. You are now allowed to add, remove, or replace all your key-value pairs to generate families of related CSS. Sass maps have default flags that can be overridden or overwritten.\r\n<br><br>\r\n<b>4.</b> Added documentation\r\nThe new documentation is added to for using the CSS variables. Bootstrap 4 provides around 2 dozen of CSS variables. These help for easy access to theme colors, breakpoints, and primary font stacks etc. It will be really useful for the users who donâ€™t want to use Sass.\r\n<br><br>\r\n<b>5.</b> New Responsive Classes\r\nThe new responsive classes .order-0 and .order-last are introduced for more control over the flexbox grid.\r\n<br><br>\r\n<b>6.</b> Endorsement for Bootstrap Approach\r\nBootstrap 4 stable version introduces the ne', , '2019-03-20', 1);
INSERT INTO `article` (`id`, `title`, `body`, `img`, `date`, `user`) VALUES
(8, 'JavaScript Tutorial', '<b>JavaScript</b> is the most popular and widely used client-side scripting language. <br><code>Client-side</code> scripting refers to scripts that run within your web browser. JavaScript is designed to add interactivity and dynamic effects to the web pages by manipulating the content returned from a web server.<br><br>\r\n\r\nJavaScript was originally developed as LiveScript by Netscape in the mid <code>1990s</code>. It was later renamed to JavaScript in 1995, and became an ECMA standard in <code>1997</code>. Now JavaScript is the standard client-side scripting language for web-based applications, and it is supported by virtually all web browsers available today, such as <b>Google Chrome, Mozilla Firefox, Apple Safari, etc.</b>\r\n<br><br>\r\nJavaScript is an object-oriented language, and it also has some similarities in syntax to Java programming language. But, <b>JavaScript</b> is not related to Java in any way.\r\n<br><br>\r\nJavaScript is officially maintained by <code>ECMA (European Computer Manufacturers Association) </code> as ECMAScript. ECMAScript 6 (or ES6) is the latest major version of the <b>ECMAScript</b> standard.\r\n<br><br>\r\nWhat You Can Do with JavaScript\r\nThere are lot more things you can do with <b>JavaScript</b>.\r\n<br><br>\r\n<b>1-</b>You can modify the content of a web page by adding or removing elements.<br><br>\r\n<b>2-</b>You can change the style and position of the elements on a web page.<br><br>\r\n<b>3-</b>You can monitor events like mouse click, hover, etc. and react to it.<br><br>\r\n<b>4-</b>You can perform and control transitions and animations.<br><br>\r\n<b>5-</b>You can create alert pop-ups to display info or warning messages to the user.<br><br>\r\n<b>6-</b>You can perform operations based on user inputs and display the results.<br><br>\r\n<b>7-</b>You can validate user inputs before submitting it to the server.<br><br>\r\nThe list does not end here, there are many other interesting things that you can do with <b>JavaScript</b>. <code>You will learn about all of them in detail in upcoming chapters.</code>\r\n<br>', , '2019-03-20', 1);
INSERT INTO `article` (`id`, `title`, `body`, `img`, `date`, `user`) VALUES
(9, 'What is android development', 'In the last <code>10 years</code>, <b>Android</b> has made a name for itself, not only with its candy-themed platform updates, but also with its widespread, and unexpected, success. In its lifetime, the open-source mobile operating system has grown to include <code>1.4 billion</code> active users and <code>80%</code> of smartphones today run Android software. Over <code>1 billion Android phones</code>  were sold in <code>2014</code> alone.\r\n<br><br>\r\nMobile developers in the programming community are the minority â€“ just over <b>9%</b> of total developers in the world say theyâ€™re focusing on mobile devices, according to Stack Overflowâ€™s <b>2015 developer survey</b>.<br> Of these mobile developers, however, Android developers make up the larger group, with 44.6% self-identifying as Android developers, compared to <b>33.4%</b> who say they are building for iOS. Even so, many companies struggle to find enough developers to complete their Android projects. This trend is likely to continue as the overall number of smartphone users â€“ and Android users, specifically â€“ continues to grow.\r\n<br><br>\r\n\r\n<b>A QUICK HISTORY LESSON</b>\r\n<br><br>\r\n<code>Back in 2005</code>, two years prior to the release of the iPhone, Google quietly purchased Android Inc., a cash-strapped startup developing an open-source mobile platform based on the Linux operating system. In 2007, Google released this software to the world.\r\n<br>\r\nThe beauty of open source, Java, and the SDK.\r\n<br><br>\r\nAs the first Android phones were announced, Google made Android open source, meaning developers could access, understand, and even modify the underlying phone software. <b>Unlike Apple</b>,<b> Google</b> chose to allow developers to freely develop and distribute apps to users without a complicated review process. Finally, Android applications would be built with Java, a well-supported and stable language with a wide base of existing developers. An Android Software Developer Kit <code>(SDK)</code> was assembled, giving app builders libraries of Java code they could include in their projects to make it easy to access device functionality. Javaâ€™s history as a mobile device application platform significantly pre-dated Android and the idea of developing Java apps for mobile phones made a lot of sense. After all, the beauty of Java is that is is well-suited to an environment where many different devices need to be supported, due to its ability to compile applications â€œjust-in-time.â€', , '2019-03-22', 1);
INSERT INTO `article` (`id`, `title`, `body`, `img`, `date`, `user`) VALUES
(10, 'What is cordova and how does it work ?', '<b>Cordova</b> ,formerly called as Phone Gap is a platform to build Native Mobile Applicatons using <code>HTML5</code>, <code>CSS</code> and Java Script.\r\n<br>\r\nIn other words it acts  a container for running a web application written in HTML, CSS,JS Typically Web applications cannot use the native device functionality like Camera, <code>GPS</code>, Accelerometer , Contacts etc. . With Cordova we can very much achieve this and package the web application in the devices installer format.\r\n\r\n<br><br>\r\n\r\n<b>Device installer formats :</b>\r\n<br><br>\r\n\r\n<code>Android</code> â€“ .apk (Android Application Package)\r\n<br>\r\n<code>IOS</code> â€“ .ipa (iPhone Application Archive) \r\n<br>\r\n<code>Windows Phone</code> .xap (Silverlight Application Package) \r\n<br><br>\r\n<b>Are PhoneGap and Apache Cordova different ?</b>\r\n<br><br>\r\n\r\nBoth are the same . But we can say that Apache Cordova as an engine that powers PhoneGap , like how Webkit is an engine that powers Chrome.\r\n\r\n', , '2019-03-22', 1);
INSERT INTO `article` (`id`, `title`, `body`, `img`, `date`, `user`) VALUES
(11, 'Ionic', '<b>Ionic</b> makes it easy to build high-performance mobile and <code>Progressive Web Apps</code> <b>(or PWAs)</b> that look and feel beautiful on any platform or device.<br>\r\nA complete app development kit.<br>\r\nThe open source Ionic Framework features a rich library of front-end building blocks and UI components that make it easy to design beautiful, high-performance mobile and Progressive Web Apps <b>(or PWAs)</b> using web technologies like <code>HTML</code>,<code> CSS</code>, and <code>JavaScript</code>.\r\n<br><br>\r\nOur universal web components pair with any JavaScript framework, including Angular, React, Vue, or no framework at all (just add a script tag!). <code>Ionic</code> apps are backend agnostic, with connections to <code>AWS</code>, <code>Azure</code>, and <code>Firebase</code>.\r\n<br><br>\r\n\r\n\r\nIonicâ€™s open source <b>Framework</b> and developer-friendly tools and services power apps for some of the worldâ€™s best-known brands - from highly successful consumer apps like Sworkit, Untappd and Dow Jones MarketWatch, to mission-critical apps supporting Nationwide, Amtrak, and <code>NASA</code>.\r\n<br><br>\r\nA supercharged platform for teams\r\nTeams building with Ionic can boost productivity with <b>Ionic Studio</b>, our powerful and secure rapid development environment, and Appflow, an integrated suite of Mobile DevOps services to automate every phase of the app lifecycle - from native builds to live updates.\r\n<br><br>\r\nFor enterprise teams, <code>Ionic offers a premier</code>, supported version of the entire Ionic ecosystem to accelerate time-to-market and enhance stability, along with <b>Ionic Advisory</b> services for customized strategies and solutions.\r\n\r\n', , '2019-03-22', 1);
INSERT INTO `article` (`id`, `title`, `body`, `img`, `date`, `user`) VALUES
(12, 'Laravel Philosophy', 'Laravel is a web application <b>framework</b> with expressive, elegant syntax. We <code>believe development</code> must be an enjoyable, creative experience to be truly fulfilling. Laravel attempts to take the pain out of development by easing common tasks used in the majority of web projects, such as authentication, routing, sessions, and caching.\r\n<br><br>\r\nLaravel aims to make the development process a pleasing one for the developer <b>without sacrificing application functionality</b>.<br> Happy developers make the best code. To this end, we\'ve attempted to combine the very best of what we have seen in other web frameworks, including frameworks implemented in other languages, such as Ruby on Rails, <code>ASP.NET MVC</code>, and <code>Sinatra</code>.\r\n<br><br>\r\nLaravel is accessible, yet powerful, providing powerful tools needed for large, robust applications. A superb inversion of <code>control</code> container, expressive migration system, and tightly integrated unit testing <b>support</b> give you the tools you need to build any application with which you are tasked.\r\n\r\n', , '2019-03-22', 1);
INSERT INTO `article` (`id`, `title`, `body`, `img`, `date`, `user`) VALUES
(13, ' SWIFT The powerful programming language.', '<b>Swift</b> is a powerful and intuitive <oce>programming language</code> for <code>macOS</code>, <code>iOS</code>, <code>watchOS</code> and <code>tvOS</code>. <br>Writing Swift code is interactive and fun, the syntax is concise yet expressive, and Swift includes modern <code>features developers</code> love. Swift code is safe by design, yet also produces software that runs lightning-fast.\r\n<br><br>\r\n\r\n<b>Introducing Swift 4</b><br>\r\nSwift 4 builds on the strengths of <code>Swift 3</code>, delivering greater robustness and stability, providing source code compatibility with Swift 3, making improvements to the standard library, and adding features like smart key paths and serialization, all while shortening build times and reducing the size of app binaries.\r\n<br><br>\r\n\r\n<b>Learn Swift on iPad</b><br>\r\nIn Swift Playgrounds you create small programs called <code>â€œplaygroundsâ€</code> that instantly show the results of the code that you write. A single line of code can make amazing things happen.<br> Interactive lessons teach key coding concepts, and additional challenges and templates encourage you to explore code in exciting new ways and to create something completely unique. There are even playgrounds that use <code>Bluetooth</code> to control robots, drones, and other hardware accessories. <br>Itâ€™s easy to share your creations with friends, or record and post videos of your playgrounds in action.\r\n<br><br>\r\n<b>Open Source</b><br>\r\nSwift 4 was developed in the open at Swift.org, with source code, a bug tracker, mailing lists, and regular development builds available for everyone.<br> This broad community of developers, both inside <code>Apple</code> as well as hundreds of outside contributors, work together to make Swift even more amazing. Swift already supports all <code>Apple platforms</code> as well as Linux, with community members actively working to port to even more platforms. Weâ€™re excited to see more ways in which Swift makes software safer and faster, while also making programming more fun.\r\n\r\n', , '2019-03-22', 1);
INSERT INTO `article` (`id`, `title`, `body`, `img`, `date`, `user`) VALUES
(14, 'What is PHP?', '<b>PHP</b> is a server side scripting language. <br> that is used to develop Static websites or Dynamic websites or Web applications. PHP stands for <code>Hypertext Pre-processor</code>, that earlier stood for Personal Home Pages.<br><br>\r\n<b>PHP scripts</b> can only be interpreted on a server that has PHP installed.\r\n<br>\r\nThe client computers accessing the PHP scripts require a <b>web browser only</b>.\r\nPHP file contains PHP tags and ends with the extension .', , '2019-03-22', 1);

